INSERT INTO `cms_article` VALUES (200, '基于若依', 1, '2021-06-08 12:49:23', 1, '2021-06-08 13:50:11', 3, '<p><span style=\'color: rgb(34, 34, 34); font-family: consolas, \"lucida console\", \"courier new\", monospace; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: pre-wrap; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\'>基于若依V4.6,除内容模块外,额外添加邮件模块,储存模块,模板模块等,方便后续开发。</span><img src=\"http://127.0.0.1/oly/oss/download/image/2021/06/08/f87e79ca-a3bc-49cb-b807-36ac8e654902.png\" style=\"width: 300px;\" class=\"fr-fic fr-dib\"></p>', 0, 0, 'http://127.0.0.1/oly/oss/download/image/2021/06/08/f87e79ca-a3bc-49cb-b807-36ac8e654902.png', '基于若依V4.6,除内容模块外,额外添加邮件模块,储存模块,模板模块等,方便后续开发。', 3, 1, '', '1623127643097', '若依', NULL, NULL, NULL);
INSERT INTO `cms_article` VALUES (207, '简介', 1, '2021-06-19 20:00:45', 1, '2021-06-22 21:49:38', 3, '<h2 id=\"h2-u5185u5BB9u76F8u5173u6A21u5757\"><a name=\"内容相关模块\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>内容相关模块</h2><p>止戈内容管理系统后基于若依V4.6.2二次开发，在已有基础已经实现了大多数内容管理所需的功能，具体如下：</p>\n<ul>\n<li>模板管理：支持普通页面,数据页面以及一些样例模板。</li><li>缓存管理：在提高系统响应方面，在若依的基础上增加内容缓存模块，同时支持查看缓存，重置缓存。</li><li>储存管理：可视化管理，提供相关接口，方便后续扩展。</li><li>邮件管理：邮件支持在线配置，发送，支持多种类型邮件发送，支持定时发送。</li><li>主题管理：支持主题上传，切换以及个性化设置，同时支持多主题同时运行。</li><li>栏目管理：前端菜单管理，支持多级树，可以应付复杂的导航,已支持额外SEO字段。</li><li>分类管理：支持多级树，完全可以应付复杂分类,已支持额外SEO字段。</li><li>标签管理：标签用于标记文章特色,已支持额外SEO字段。</li><li>文章管理：支持不同类型，特色推荐，多关键字的文章发布，支持额外SEO字段。</li><li>配置管理：完整的网站配置，参数设置，以应对个性化设置。</li><li>链接管理：支持分组,方便做导航类网站。</li><li>基础页面：提供基础页面，方便主题二次开发，基本满足基本内容所需。</li><li>自定页面：基础页面不能满足需求，可使用自定义页面，能满足大多数内容场景。</li><li>标签开发：提供内容相关标签，可开发出所需的内容页面，在不了解服务器也能制作出精美的主题。</li><li>提供API: 提供一些内容相关API,方便后续开发，或者单页面开发。</li><li>UniApp:  提供UniApp简单淘客推广模式。</li><li>淘客推广：目前支持比较简单的推广,支持淘宝，京东链接批量导入，以及手动导入。</li><li>文章操作：包含评论,分享,评分,收藏等。</li><li>多站模式：支持多个站点同时运行，通过一定的配置，每个站点都可以数据独立。</li></ul>\n<h2 id=\"h2-u652Fu6301u573Au666F\"><a name=\"支持场景\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>支持场景</h2><ol>\n<li>个人网站</li><li>企业网站</li><li>优惠卷推广</li><li>论坛建设</li><li>群站模式</li><li>项目文档</li><li>小程序等<h2 id=\"h2-u9879u76EEu9884u89C8\"><a name=\"项目预览\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>项目预览</h2><h3 id=\"h3-u540Eu53F0\"><a name=\"后台\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>后台</h3></li></ol>\n<h3 id=\"h3-u4E3Bu9898u9884u89C8\"><a name=\"主题预览\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>主题预览</h3><h3 id=\"h3-uniapp-\"><a name=\"UniApp预览\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>UniApp预览</h3><h2 id=\"h2-qq-\"><a name=\"qq群\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>qq群</h2><h2 id=\"h2-u5728u7EBFu4F53u9A8C\"><a name=\"在线体验\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>在线体验</h2><ul>\n<li>admin/admin123  </li><li>陆陆续续收到一些打赏，为了更好的体验已用于演示服务器升级。谢谢各位小伙伴。</li></ul>\n<p>演示地址：<a href=\"http://ruoyi.vip\">http://ruoyi.vip</a><br>文档地址：<a href=\"http://doc.ruoyi.vip\">http://doc.ruoyi.vip</a></p>\n<h2 id=\"h2-u6F14u793Au56FE\"><a name=\"演示图\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>演示图</h2><h2 id=\"h2-u82E5u4F9Du4EA4u6D41u7FA4\"><a name=\"若依交流群\" class=\"reference-link\"></a><span class=\"header-link octicon octicon-link\"></span>若依交流群</h2><p>QQ群：</p>\n', 1, 0, '', 'Edito\n\n目录(TableofContents)\n[TOCM][TOC]Heading1Heading2Heading3Heading4Heading5Heading6Heading1linkHeadinglinkHeading2linkHeadinglinkHeading3linkHeadinglinkHeadi', 3, 1, '', '1624103178929', '止戈文档,止戈主页', '', '\n\n											', '## 内容相关模块\n止戈内容管理系统后基于若依V4.6.2二次开发，在已有基础已经实现了大多数内容管理所需的功能，具体如下：\n* 模板管理：支持普通页面,数据页面以及一些样例模板。\n* 缓存管理：在提高系统响应方面，在若依的基础上增加内容缓存模块，同时支持查看缓存，重置缓存。\n* 储存管理：可视化管理，提供相关接口，方便后续扩展。\n* 邮件管理：邮件支持在线配置，发送，支持多种类型邮件发送，支持定时发送。\n* 主题管理：支持主题上传，切换以及个性化设置，同时支持多主题同时运行。\n* 栏目管理：前端菜单管理，支持多级树，可以应付复杂的导航,已支持额外SEO字段。\n* 分类管理：支持多级树，完全可以应付复杂分类,已支持额外SEO字段。\n* 标签管理：标签用于标记文章特色,已支持额外SEO字段。\n* 文章管理：支持不同类型，特色推荐，多关键字的文章发布，支持额外SEO字段。\n* 配置管理：完整的网站配置，参数设置，以应对个性化设置。\n* 链接管理：支持分组,方便做导航类网站。\n* 基础页面：提供基础页面，方便主题二次开发，基本满足基本内容所需。\n* 自定页面：基础页面不能满足需求，可使用自定义页面，能满足大多数内容场景。\n* 标签开发：提供内容相关标签，可开发出所需的内容页面，在不了解服务器也能制作出精美的主题。\n* 提供API: 提供一些内容相关API,方便后续开发，或者单页面开发。\n* UniApp:  提供UniApp简单淘客推广模式。\n* 淘客推广：目前支持比较简单的推广,支持淘宝，京东链接批量导入，以及手动导入。\n* 文章操作：包含评论,分享,评分,收藏等。\n* 多站模式：支持多个站点同时运行，通过一定的配置，每个站点都可以数据独立。\n\n## 支持场景\n1. 个人网站\n2. 企业网站\n3. 优惠卷推广\n4. 论坛建设\n5. 群站模式\n6. 项目文档\n6. 小程序等\n## 项目预览\n### 后台\n\n### 主题预览\n\n### UniApp预览\n\n## qq群\n\n## 在线体验\n\n\n\n\n- admin/admin123  \n- 陆陆续续收到一些打赏，为了更好的体验已用于演示服务器升级。谢谢各位小伙伴。\n\n演示地址：http://ruoyi.vip  \n文档地址：http://doc.ruoyi.vip\n\n## 演示图\n\n\n\n\n## 若依交流群\n\nQQ群：');
