INSERT INTO `sys_oper_log` VALUES (350, '邮件', 1, 'com.oly.mail.controller.OlyMailController.send()', 'POST', 1, 'admin', '研发部门', '/oly/mail/send', '127.0.0.1', '内网IP', '{\"toMail\":[\"1819539343@qq.com\"],\"subject\":[\"你有一条短消息请注意查收！\"],\"mailType\":[\"2\"],\"copyTo\":[\"\"],\"bccTo\":[\"\"],\"attachKeys\":[\"\"],\"content\":[\"<div><p>重庆交警把一个骑摩托车拦下，并让司机出示证件。</p><p>司机说: 都是重庆人，哥子给个面子撒，本本儿忘带了，我家斗在勒点的。</p><p>交警说: 莫豁我，你不是重庆嘞。</p><p>司机反问: 你郎个晓得我不是重庆嘞? ?</p><p>交警说: 你莫不承认，等我拦个重庆的给你看哈。</p><p>这时候一小伙子骑摩托过来了，交警摆手拦车!结果摩托车飞奔而过，风中远远传来一句: 你个哈批! 过来抓老子撒!</p><p>交警转身对刚才的司机说: 看到没得! 勒个才是重庆的! 你娃儿一看就是成都的。</p></div>\"],\"undefined\":[\"\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2021-03-08 14:36:30');
