INSERT INTO `sys_oper_log` VALUES (639, '主题管理-保存主题内容', 2, 'com.oly.cms.web.controller.CmsThemeController.themeContentSave()', 'POST', 1, 'admin', '研发部门', '/cms/theme/themeContentSave', '127.0.0.1', '内网IP', '{\"path\":[\"/zgblog/about.html\"],\"content\":[\"<!DOCTYPE html>\\n<html lang=\\\"zh\\\" xmlns:th=\\\"http://www.thymeleaf.org\\\">\\n<head>\\n\\t<th:block   th:include=\\\"themes/zgblog/blog_include :: blogHeader(title=${blogConfig[\'blog.config.title\'].configValue+\'-\'+menu.columnName},\\nkeywords=${blogConfig[\'blog.config.keywords\'].configValue+\',\'+menu.keywords},\\ndescription=${menu.description},\\nblogConfig=${blogConfig})\\\"/>\\n</head>\\n\\t<body>\\n\\t <th:block th:include=\\\"themes/zgblog/blog_include::menu(menus=${@menuTag.getMenu(21)},blogConfig=${blogConfig})\\\"/>\\n\\t\\t<!-- 主体部分 -->\\n\\t\\t<section class=\\\"zgblog-main-box\\\">\\n\\t\\t\\t<div class=\\\"layui-row \\\">\\n\\t\\t\\t\\t<div class=\\\"layui-col-md9  zgblog-left-box\\\">\\n\\t\\t\\t\\t\\t<div class=\\\"zgblog-left-content\\\">\\n\\t\\t\\t\\t\\t\\t<th:block th:include=\\\"themes/zgblog/blog_include::blogAbout(blogConfig=${blogConfig})\\\"/>\\n\\t\\t\\t\\t\\t</div>\\n\\t\\t\\t\\t</div>\\n\\t\\t\\t\\t<!-- 主体部分右边 -->\\n\\t\\t\\t\\t<div class=\\\"layui-col-md3 zgblog-right-box\\\">\\n\\t\\t\\t\\t\\t<th:block th:include=\\\"themes/zgblog/blog_include::rightCommen\\\"/>\\n\\t\\t\\t\\t</div>\\n\\t\\t\\t</div>\\n\\n\\t\\t</section>\\n\\n\\t\\t<!-- 底部导航 -->\\n\\t\\t<th:block th:include=\\\"themes/zgblog/blog_include::bottom\\\" />\\n\\t\\t<th:block th:include=\\\"themes/zgblog/blog_include::footer_js\\\" />\\n\\n\\t</body>\\n\\n</html>\\n\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2021-03-17 16:05:28');
INSERT INTO `sys_oper_log` VALUES (640, '主题管理-保存主题内容', 2, 'com.oly.cms.web.controller.CmsThemeController.themeContentSave()', 'POST', 1, 'admin', '研发部门', '/cms/theme/themeContentSave', '127.0.0.1', '内网IP', '{\"path\":[\"/zgblog/index.html\"],\"content\":[\"<!DOCTYPE html>\\n<html lang=\\\"zh\\\" xmlns:th=\\\"http://www.thymeleaf.org\\\">\\n<head>\\n\\t<th:block   th:include=\\\"themes/zgblog/blog_include :: blogHeader(title=${blogConfig[\'oly.web.config.title\'].configValue+\'-\'+menu.columnName},\\nkeywords=${blogConfig[\'oly.web.config.keywords\'].configValue+\',\'+menu.keywords},\\ndescription=${menu.description},\\nblogConfig=${blogConfig})\\\"/>\\n</head>\\n<body>\\n<!--导航-->\\n<th:block th:include=\\\"themes/zgblog/blog_include::menu(menus=${@menuTag.getMenu(21)},blogConfig=${blogConfig})\\\"/>\\n\\t<!-- 主体部分 -->\\n\\n\\t<section class=\\\"zgblog-main-box\\\">\\n\\t\\t<div class=\\\"layui-row\\\">\\n\\t\\t\\t<!-- 主体部分左边 -->\\n\\t\\t\\t<div class=\\\"layui-col-md9  zgblog-left-box\\\">\\n\\t\\t\\t\\t<div class=\\\"zgblog-left-content\\\">\\n\\t\\t\\t<th:block th:include=\\\"themes/zgblog/blog_include::blogArticles(posts=${@articleTag.indexPosts(72)})\\\"/>\\n\\t\\t\\t\\t</div>\\n\\t\\t\\t</div>\\n\\t\\t\\t<!-- 主体部分右边 -->\\n\\t\\t\\t<div class=\\\"layui-col-md3 zgblog-right-box\\\" >\\n\\t\\t\\t\\t<th:block th:include=\\\"themes/zgblog/blog_include::rightCommen\\\"/>\\n\\t\\t\\t</div>\\n\\t\\t</div>\\n\\n\\t</section>\\n\\n\\t<!-- 底部导航 -->\\n\\t<th:block th:include=\\\"themes/zgblog/blog_include::bottom\\\"/>\\n\\t<th:block th:include=\\\"themes/zgblog/blog_include::footer_js\\\"/>\\n\\n\\t<script th:inline=\\\"JavaScript\\\">\\n\\t//模拟分页\\n\\t$(\\\".zgblog-post-page>div>a\\\").click(function(){\\n\\t\\t$(\\\".zgblog-post-page>div>a\\\").removeClass(\\\"page-this\\\");\\n\\t\\t$(this).addClass(\\\"page-this\\\");\\n\\t\\t$(\\\".zgblog-post-list\\\").hide();\\n\\t\\t$(\\\".post-page-\\\"+$(this).html()).show();\\n\\t});\\n    $(\\\".zgblog-post-list\\\").hide();\\n    $(\\\".post-page-1\\\").show();\\n\\t</script>\\n</body>\\n\\n</html>\\n\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2021-03-17 16:07:02');
