\\\">\\n                    <div class=\\\"layui-input-block\\\">\\n                        <button type=\\\"button\\\" class=\\\"layui-btn layui-btn-normal\\\" id=\\\"getEmailCode\\\">获取验证码</button>\\n                    </div>\\n                </div>\\n                <div class=\\\"layui-form-item\\\">\\n                    <label class=\\\"layui-form-label\\\">密码</label>\\n                    <d', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2021-03-17 16:07:40');
