inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\\\">记者：美国家安全委员会日前发布《临时国家安全战略纲要》称，在美国的竞争对手里，中国是唯一具备经济和军事等实力挑战现行国际体系的国家。美国防部将中国列为&ldquo;首要挑战&rdquo;，美防长奥斯汀在访问日韩时称，美国的目标是对中国或任何想与美国较量者做', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2021-03-25 16:28:36');
