INSERT INTO `sys_oper_log` VALUES (1603, '内容文章管理', 1, 'com.oly.cms.web.controller.CmsArticleController.add()', 'POST', 1, 'admin', '研发部门', '/cms/article/add', '127.0.0.1', '内网IP', '{\"articleTitle\":[\"这是测试文章6\"],\"articleUrl\":[\"1623395895480\"],\"keywords\":[\"多个\"],\"articleContent\":[\"<h1 id=\\\"h1--7-2\\\"><a name=\\\"支撑起整个互联网时代的 7 款开源软件-2\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>支撑起整个互联网时代的 7 款开源软件-2</h1><p>Linux可以说是已经无处不在，像Android手机就是以Linux为基础开发的，世界上大多的超级计算机也都采用的Linux系统，大多数的 数据中心使用Linux作为其支撑操作系统。谷歌、百度、淘宝等都通过Linuxt提供了我们每天用的互联网服务。Linux在航空控制系统中也扮演着重 要角色。</p>\\r\\n<h3 id=\\\"h3--openssl\\\"><a name=\\\"加密互联网的安全协议OpenSSL\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>加密互联网的安全协议OpenSSL</h3><p>OpenSSL是套开放源代码的软件库包，实现了SSL与TLS协议。OpenSSL可以说是一个基于密码学的安全开发包，囊括了主要的密码算法、常用的密钥和证书封装管理功能以及SSL协议，并提供了丰富的应用程序供测试或其它目的使用。</p>\\r\\n<p>也可以说OpenSSL是网络通信提供安全及数据完整性的一种安全协议，SSL可以在Internet上提供秘密性传输，能使用户/服务器应用之间的通信不被攻击者窃听。OpenSSL被网银、在线支付、电商网站、门户网站、电子邮件等重要网站广泛使用。</p>\\r\\n<p>去年OpenSSL爆出安全漏洞，因为其应用如此之广，该漏洞爆出让整个互联网都为之震颤。</p>\\r\\n<h3 id=\\\"h3--mysql\\\"><a name=\\\"互联网的记忆——MySQL\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>互联网的记忆——MySQL</h3><p>MySQL是一个开源的小型的数据库管理系统，原开发者为瑞典的MySQL AB公司，该公司于2008年被Sun公司收购。2009年，甲骨文公司（Oracle）收购Sun公司，MySQL成为Oracle旗下产品。</p>\\r\\n<p>很多信息都是存在数据库里面的，很多工程师在开发一些的小型项目时都会采用这个MySQL数据库。MySQL为C、C++、JAVA、PHP等多重 编程语言提供了API接口。而且支持windows、Mac、Linux等多种系统。这种广泛的支持使其得到更多开发者的青睐，MySQL是开发者需要掌 握的数据库之一。</p>\\r\\n<p>Mysql最初为小型应用而开发，但现在的Mysql已经不是一个小型数据库了。基本上所有的互联网公司都会使用这个数据库系统，一些金融交易也会 采用Mysql作为数据库引擎。Mysql通过相应的调优既可以支撑大规模的访问，又可以保证数据安全性，已经成为威胁传统商业数据库系统的重要力量。</p>\\r\\n<h3 id=\\\"h3--eclipse\\\"><a name=\\\"万能开发工具Eclipse\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>万能开发工具Eclipse</h3><p>Eclipse 是一个开放源代码的、基于Java的可扩展开发平台。Eclipse最初由OTI和IBM两家公司的IDE产品开发组创建，起始于1999年4月。目前由 IBM牵头，围绕着Eclipse项目已经发展成为了一个庞大的Eclipse联盟，有150多家软件公司参与到Eclipse项目中，其中包括 Borland、Rational Software、Red Hat及Sybase等。</p>\\r\\n<p>就其本身而言，它只是一个框架和一组服务，用于通过插件组件构建开发环境。很多Java编程软件都是在Eclipse平台开发的，还有包括 Oracle在内的许多大公司也纷纷加入了该项目，并宣称Eclipse将来能成为可进行任何语言开发的IDE集大成者，使用者只需下载各种语言的插件即 可。</p>\\r\\n<p>Eclipse并不是一个直接服务于消费者的产品，', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2021-06-11 15:18:49');
INSERT INTO `sys_oper_log` VALUES (1604, '内容文章管理', 2, 'com.oly.cms.web.controller.CmsArticleController.editSave()', 'POST', 1, 'admin', '研发部门', '/cms/article/edit', '127.0.0.1', '内网IP', '{\"articleId\":[\"199\"],\"articleTitle\":[\"电信冲20送10\"],\"articleUrl\":[\"/1620710567725\"],\"keywords\":[\"送1000,hgfhgf\"],\"articleContent\":[\"<h2><img src=\\\"http://127.0.0.1/oly/oss/download/image/2021/05/11/b4168f51-2779-425a-897b-923180bf3104.jpg\\\" style=\\\"width: 300px;\\\" class=\\\"fr-fic fr-dib\\\">The three greatest things you learn from traveling</h2><p>Like all the great things on earth traveling teaches us by\\r\\nexample. Here are some of the most precious lessons I&rsquo;ve learned\\r\\nover the years of traveling.</p><h3>Appreciation of diversity</h3><p>Getting used to an entirely different culture can be challenging. While it&rsquo;s also nice to learn about cultures online or from books, nothing comes close to experiencing <a href=\\\"https://en.wikipedia.org/wiki/Cultural_diversity\\\">cultural\\r\\ndiversity</a> in person. You learn to appreciate each and every single one of the differences while you become more culturally fluid.</p><h3>Confidence</h3><p>Going to a new place can be quite terrifying. While change\\r\\nand uncertainty makes us scared, traveling teaches us how\\r\\nridiculous it is to be afraid of something before it happens.\\r\\nThe moment you face your fear and see there was nothing to be\\r\\nafraid of, is the moment you discover bliss.</p>\"],\"cats\":[\"28,34\"],\"tags\":[\"22,25\"],\"chooseTag\":[\"\"],\"articleType\":[\"1\"],\"allowComment\":[\"1\"],\"description\":[\"\"],\"reprintUrl\":[\"\"],\"articleImg\":[\"http://127.0.0.1/oly/oss/download/image/2021/05/11/b4168f51-2779-425a-897b-923180bf3104.jpg\"],\"articleSummary\":[\"ThethreegreatestthingsyoulearnfromtravelingLikeallthegreatthingsonearthtravelingteachesusby\\r\\nexample.HerearesomeofthemostpreciouslessonsI&rsquo;velearned\\r\\noverthe\"]}', '{\r\n  \"msg\" : \"操作成功\",\r\n  \"code\" : 0\r\n}', 0, NULL, '2021-06-11 19:05:21');
INSERT INTO `sys_oper_log` VALUES (1605, '内容文章管理', 1, 'com.oly.cms.web.controller.CmsArticleController.add()', 'POST', 1, 'admin', '研发部门', '/cms/article/add', '127.0.0.1', '内网IP', '{\"articleImg\":[\"\"],\"articleMd\":[\"#支撑起整个互联网时代的 7 款开源软件-2\\n\\nLinux可以说是已经无处不在，像Android手机就是以Linux为基础开发的，世界上大多的超级计算机也都采用的Linux系统，大多数的 数据中心使用Linux作为其支撑操作系统。谷歌、百度、淘宝等都通过Linuxt提供了我们每天用的互联网服务。Linux在航空控制系统中也扮演着重 要角色。\\n\\n###加密互联网的安全协议OpenSSL\\n\\nOpenSSL是套开放源代码的软件库包，实现了SSL与TLS协议。OpenSSL可以说是一个基于密码学的安全开发包，囊括了主要的密码算法、常用的密钥和证书封装管理功能以及SSL协议，并提供了丰富的应用程序供测试或其它目的使用。\\n\\n也可以说OpenSSL是网络通信提供安全及数据完整性的一种安全协议，SSL可以在Internet上提供秘密性传输，能使用户/服务器应用之间的通信不被攻击者窃听。OpenSSL被网银、在线支付、电商网站、门户网站、电子邮件等重要网站广泛使用。\\n\\n去年OpenSSL爆出安全漏洞，因为其应用如此之广，该漏洞爆出让整个互联网都为之震颤。\\n\\n### 互联网的记忆——MySQL\\n\\nMySQL是一个开源的小型的数据库管理系统，原开发者为瑞典的MySQL AB公司，该公司于2008年被Sun公司收购。2009年，甲骨文公司（Oracle）收购Sun公司，MySQL成为Oracle旗下产品。\\n\\n很多信息都是存在数据库里面的，很多工程师在开发一些的小型项目时都会采用这个MySQL数据库。MySQL为C、C++、JAVA、PHP等多重 编程语言提供了API接口。而且支持windows、Mac、Linux等多种系统。这种广泛的支持使其得到更多开发者的青睐，MySQL是开发者需要掌 握的数据库之一。\\n\\nMysql最初为小型应用而开发，但现在的Mysql已经不是一个小型数据库了。基本上所有的互联网公司都会使用这个数据库系统，一些金融交易也会 采用Mysql作为数据库引擎。Mysql通过相应的调优既可以支撑大规模的访问，又可以保证数据安全性，已经成为威胁传统商业数据库系统的重要力量。\\n\\n### 万能开发工具Eclipse\\n\\nEclipse 是一个开放源代码的、基于Java的可扩展开发平台。Eclipse最初由OTI和IBM两家公司的IDE产品开发组创建，起始于1999年4月。目前由 IBM牵头，围绕着Eclipse项目已经发展成为了一个庞大的Eclipse联盟，有150多家软件公司参与到Eclipse项目中，其中包括 Borland、Rational Software、Red Hat及Sybase等。\\n\\n就其本身而言，它只是一个框架和一组服务，用于通过插件组件构建开发环境。很多Java编程软件都是在Eclipse平台开发的，还有包括 Oracle在内的许多大公司也纷纷加入了该项目，并宣称Eclipse将来能成为可进行任何语言开发的IDE集大成者，使用者只需下载各种语言的插件即 可。\\n\\nEclipse并不是一个直接服务于消费者的产品，它更像一个工匠手中万用工具，用Eclipse开发者可以打造出各种充满创造性的服务来满足最终用户的需求。\\n\\n### 互联网的门卫Apache\\n\\nApache HTTP Server（简称Apache）是Apache软件基金会的一个开放源码的网页服务器，可以在大多数计算机操作系统中运行，由于其多平台和安全性被广泛 使用，也是最流行的Web服务器端软件之一，市场占有率达60%左右。它快速、可靠并且可通过简单的API扩展，它可以和各种解释器配合使用，包括 PHP/Perl/Python等。\\n\\nApache就像一个负责的门卫，管理着服务器数据的进出。每当你在你的地址栏里输入 http://XXX.com 的时候，在遥远的远端，很有可能正是一台跑着Apache的服务器，将你需要的信息传输给浏览器。\\n\\n###大数据的心脏Hadoop\\n\\nHadoop 是一个能够对大量数据进行分布式处理的软件框架，由Apache基金会开发。用户可以在不了解分布式底层细节的情况下，开发分布式程序。Hadoop 一 直帮助解决各种问题，包括超大型数据集的排序和大文件的搜索。它还是各种搜索引擎的核心，比如 Amazon 的 A9 和用于查找酒信息 的 Able Grape 垂直搜索引擎。阿里巴巴集团在商品推荐、用户行为分析、信用计算领域也都有hadoop的应用。\\n\\n在“大数据”已经成为潮流的当下，Hadoop已经成为最主要的一项技术。可以毫不夸张的说，没有Hadoop，就没有大多数的大数据应用。可以说对一个不知道Hado', NULL, 1, 'nested exception is org.apache.ibatis.builder.BuilderException: The expression \'array\' evaluated to a null value.', '2021-06-11 21:33:04');
