INSERT INTO `sys_oper_log` VALUES (1670, '内容文章管理', 2, 'com.oly.cms.web.controller.CmsArticleController.editSave()', 'POST', 1, 'admin', '研发部门', '/cms/article/edit', '180.164.135.48', 'XX XX', '{\"articleId\":[\"207\"],\"articleTitle\":[\"简介\"],\"articleUrl\":[\"1624103178929\"],\"keywords\":[\"止戈文档,止戈主页\"],\"editor-markdown-doc\":[\"## 内容相关模块\\r\\n止戈内容管理系统后基于若依V4.6.2二次开发，在已有基础已经实现了大多数内容管理所需的功能，具体如下：\\r\\n* 模板管理：支持普通页面,数据页面以及一些样例模板。\\r\\n* 缓存管理：在提高系统响应方面，在若依的基础上增加内容缓存模块，同时支持查看缓存，重置缓存。\\r\\n* 储存管理：可视化管理，提供相关接口，方便后续扩展。\\r\\n* 邮件管理：邮件支持在线配置，发送，支持多种类型邮件发送，支持定时发送。\\r\\n* 主题管理：支持主题上传，切换以及个性化设置，同时支持多主题同时运行。\\r\\n* 栏目管理：前端菜单管理，支持多级树，可以应付复杂的导航,已支持额外SEO字段。\\r\\n* 分类管理：支持多级树，完全可以应付复杂分类,已支持额外SEO字段。\\r\\n* 标签管理：标签用于标记文章特色,已支持额外SEO字段。\\r\\n* 文章管理：支持不同类型，特色推荐，多关键字的文章发布，支持额外SEO字段。\\r\\n* 配置管理：完整的网站配置，参数设置，以应对个性化设置。\\r\\n* 链接管理：支持分组,方便做导航类网站。\\r\\n* 基础页面：提供基础页面，方便主题二次开发，基本满足基本内容所需。\\r\\n* 自定页面：基础页面不能满足需求，可使用自定义页面，能满足大多数内容场景。\\r\\n* 标签开发：提供内容相关标签，可开发出所需的内容页面，在不了解服务器也能制作出精美的主题。\\r\\n* 提供API: 提供一些内容相关API,方便后续开发，或者单页面开发。\\r\\n* UniApp:  提供UniApp简单淘客推广模式。\\r\\n* 淘客推广：目前支持比较简单的推广,支持淘宝，京东链接批量导入，以及手动导入。\\r\\n* 文章操作：包含评论,分享,评分,收藏等。\\r\\n* 多站模式：支持多个站点同时运行，通过一定的配置，每个站点都可以数据独立。\\r\\n\\r\\n## 内置功能\\r\\n1.  用户管理：用户是系统操作者，该功能主要完成系统用户配置。\\r\\n2.  部门管理：配置系统组织机构（公司、部门、小组），树结构展现支持数据权限。\\r\\n3.  岗位管理：配置系统用户所属担任职务。\\r\\n4.  菜单管理：配置系统菜单，操作权限，按钮权限标识等。\\r\\n5.  角色管理：角色菜单权限分配、设置角色按机构进行数据范围权限划分。\\r\\n6.  字典管理：对系统中经常使用的一些较为固定的数据进行维护。\\r\\n7.  参数管理：对系统动态配置常用参数。\\r\\n8.  通知公告：系统通知公告信息发布维护。\\r\\n9.  操作日志：系统正常操作日志记录和查询；系统异常信息日志记录和查询。\\r\\n10. 登录日志：系统登录日志记录查询包含登录异常。\\r\\n11. 在线用户：当前系统中活跃用户状态监控。\\r\\n12. 定时任务：在线（添加、修改、删除)任务调度包含执行结果日志。\\r\\n13. 代码生成：前后端代码的生成（java、html、xml、sql）支持CRUD下载 。\\r\\n14. 系统接口：根据业务代码自动生成相关的api接口文档。\\r\\n15. 服务监控：监视当前系统CPU、内存、磁盘、堆栈等相关信息。\\r\\n16. 缓存监控：对系统的缓存查询，删除、清空等操作。\\r\\n17. 在线构建器：拖动表单元素生成相应的HTML代码。\\r\\n18. 连接池监视：监视当前系统数据库连接池状态，可进行分析SQL找出系统性能瓶颈。\\r\\n\\r\\n## 在线体验\\r\\n\\r\\n- admin/admin123  \\r\\n- 陆陆续续收到一些打赏，为了更好的体验已用于演示服务器升级。谢谢各位小伙伴。\\r\\n\\r\\n演示地址：http://ruoyi.vip  \\r\\n文档地址：http://doc.ruoyi.vip\\r\\n\\r\\n## 演示图\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n## 若依交流群\\r\\n\\r\\nQQ群：\"],\"editor-html-code\":[\"<h2 id=\\\"h2-u5185u5BB9u76F8u5173u6A21u5757\\\"><a name=\\\"内容相关模块\\\" class=\\\"reference-link\\\"></a><span class=\\\"header-link octicon octicon-link\\\"></span>内容相关模块</h2><p>止戈内容管理系统后基于若依V4.6.2二次开发，在已有基础已经实现了大多数内容管理所需的功能，具体如下：</', '{\n  \"msg\" : \"操作成功\",\n  \"code\" : 0\n}', 0, NULL, '2021-06-22 21:28:35');
