-- ----------------------------
-- Table structure for cms_article
-- ----------------------------
DROP TABLE IF EXISTS `cms_article`;
CREATE TABLE `cms_article`  (
  `article_id` bigint NOT NULL AUTO_INCREMENT COMMENT '文章id',
  `article_title` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '文章标题',
  `create_by` bigint NULL DEFAULT NULL COMMENT '发表人',
  `create_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `update_by` bigint NULL DEFAULT NULL COMMENT '更新人',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `article_type` tinyint NULL DEFAULT NULL COMMENT '文章类型',
  `article_content` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '文章内容',
  `article_build` tinyint NULL DEFAULT NULL COMMENT '编译器',
  `article_top` tinyint NULL DEFAULT NULL COMMENT '顶置级别',
  `article_img` varchar(1024) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT '\"\"' COMMENT '预览缩略图',
  `article_summary` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '文章预览',
  `visible` tinyint(1) NULL DEFAULT NULL COMMENT '可见性 0隐藏 1显示',
  `allow_comment` tinyint(1) NULL DEFAULT NULL COMMENT '是否允许回复 0关闭 1开启',
  `reprint_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '转载url',
  `article_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '文章链接别名',
  `keywords` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT '' COMMENT '关键词',
  `description` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT '' COMMENT '描述',
  `article_toc` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '文章目录',
  `article_md` text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT 'md源码',
  PRIMARY KEY (`article_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 208 CHARACTER SET = utf8 COLLATE = utf8_bin ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of cms_article
-- ----------------------------

