  `cat_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT '' COMMENT '类目地址',
  `parent` bit(1) NULL DEFAULT b'0' COMMENT '节点 0 默认非节点',
